import React from 'react'
import Navbar from './../Components/Navbar';
import { Announcement } from './../Components/Announcement';
import { styled } from 'styled-components';

const Container = styled.div``

const Item = () => {
  return (
    <Container>
        <Navbar/>
        <Announcement/>
    </Container>
  )
}

export default Item
